import React, { Component } from 'react';

class Projects extends Component {
    render() {
        return (
<div class="card" style={{width: "18rem", textAlign:'left', fontFamily:'monospace'}}>
  <img class="card-img-top" src="./img/fuck.svg" alt="Card image cap" />
  <div class="card-body">
    <h5 class="card-title text-dark">Personal Website 1.0</h5>
    <p class="card-text text-primary">Full Stack CRUD app that allows users to submit songs to a que for your favorite DJ to play.</p>
    <p class="card-text text-primary">Technologies: HTML, CSS, JavaScript, Node.js, Express.js, BCrypt, jQuery, PostgreSQL.</p>


    <a href="#" class="btn btn-danger">Demo</a>
    <a href="#" style={{marginLeft:'15px'}} class="btn btn-dark">Github Repo</a>
  </div>
</div>

        );
    }
}

export default Projects;
